import React from "react";
import DeleteOutlineIcon from '@mui/icons-material/DeleteOutline';

const Notes = (props) => {
    return (
        <>
            <div className="note">
                <h1>{props.title}</h1>
                <br />
                <p>{props.content}</p>
                <button className="btn">
                    <DeleteOutlineIcon className="delete_icon" />
                </button>
            </div>
        </>
    );
}

export default Notes;
